class Day {
    constructor(dayAbv, date) {
        this[`${dayAbv}Date_es_:date`] = date
        for (let index = 1; index < 5; index++) {
            let end = ""
            if (index != 1){
                end = `_${index}`
            }
            this[`${dayAbv}Type Reg Vac Sick Pers Hol${end}`] = "Reg";
            this[`${dayAbv}In${end}`] = undefined;
            this[`${dayAbv}Out${end}`] = undefined;          
        }
        this.num1 = 2
        this.num2 = 3
        // this[`${dayAbv}HOURS WORKED`] = this.hoursWorked()

    }

    [`SUNHOURS WORKED`]() {
